import React from 'react';
import './App.css';
import Catalog from './Catalog.js';
import 'bootstrap/dist/css/bootstrap.min.css';
import Table from '@material-ui/core/Table';
import TableHead from '@material-ui/core/TableHead';
import TableBody from '@material-ui/core/TableBody';
import TableRow from '@material-ui/core/TableRow';
import TableCell from '@material-ui/core/TableHead';
import Paper from '@material-ui/core/Paper';
import myimg from './images/bulls.png';

const items= [
  {name: "Chicago Bulls Snapback Hat", league: "NBA", style: "Snapback", price: "15", image: "./images/bulls.png"},
  {name: "Boston Celtics Adjustable Hat", league: "NBA", style: "Ball Cap", price: "17", image: "./images/celtics.jpg"},
  {name: "Cleveland Indians Snapback Hat", league: "MLB", style: "Snapback", price: "24", image: "./images/clevelandindians.jpg"},
  {name: "Los Angeles Dodgers Snapback Hat", league: "MLB", style: "Snapback", price: "29", image: "./images/dodgers.jpg"},
  {name: "Miami Heat Adjustable Hat", league: "NBA", style: "Ball Cap", price: "18", image: "./images/heat.jpg"},
  {name: "Los Angeles Lakers Snapback Hat", league: "NBA", style: "Snapback", price: "26", image: "./images/lakers.jpg"},
  {name: "Dallas Mavericks Adjustable Hat", league: "NBA", style: "Ball Cap", price: "21", image: "./images/mavs.jpg"},
  {name: "Boston Red Sox Snapback Hat", league: "MLB", style: "Snapback", price: "30", image: "./images/redsox.jpg"},
  {name: "Portland Trail Blazers Adjustable Hat", league: "NBA", style: "Ball Cap", price: "23", image: "./images/trailblazers.jpg"},
  {name: "San Francisco Warriors Adjustable Hat", league: "NBA", style: "Ball Cap", price: "28", image: "./images/warriors.jpg"},
  {name: "Chicago White Sox Snapback Hat", league: "MLB", style: "Snapback", price: "22", image: "./images/whitesox.jpg"},
  {name: "New York Yankees Snapback Hat", league: "MLB", style: "Snapback", price: "25", image: "./images/yankees.jpg"},
]

class App extends React.Component {
  render() {
    return (
      <div>
        <Paper>
      <Table>
        <TableHead>
          <TableRow>
            <TableCell>Dessert (100g serving)</TableCell>
            <TableCell align="right">Calories</TableCell>
            <TableCell align="right">Fat (g)</TableCell>
            <TableCell align="right">Carbs (g)</TableCell>
            <TableCell align="right">Protein (g)</TableCell>
          </TableRow>
        </TableHead>
      </Table>
    </Paper>
        <h1>Sports Hats &amp; Caps</h1>
        {/* <img src={myimg} /> */}
        <Catalog list={items}/>
      </div>
    );
  }
}

export default App;
